&lt;!-- Introduction --&gt;

---

# Overview - Major contributions

&amp;nbsp;

  * Provide a new perspective to solving large-scale inferential problems using non-parametric mixtures
  
  * Propose a new likelihood-based method for estimation in multiple hypothesis testing and covariance matrix estimation
  
  * Propose distance-based alternatives for estimating the mixing distribution and modify likelihood-based and distance-based methods to accommodate very large-scale computation
  
  * Propose a new FDR-controlling procedure based on the estimated null proportion and its estimated mixing distribution
  
  * Implement the new methods in `\(\textsf{R}\)` and C++, and conduct numerical studies
  
---

# Overview - Non-parametric Mixtures

The non-parametric mixtures assume that the distribution of all underlying incidental parameters is treated as completely unspecified as to whether it is discrete, continuous or in any particular family of distributions, i.e.,
`$$f(x; G, \sigma) = \int\phi(x; \mu, \sigma)dG(\mu),$$`
where `\(G\)` is a mixing distribution and `\(\sigma\)` is a fixed structural parameter.

&amp;nbsp;

In practice, we only need to consider a discrete `\(G\)`, i.e.,

`$$f(x; G, \sigma) = \sum_{i = 1}^m\pi_i\phi(x; \mu_i, \sigma),$$`
and estimate `\(\pi_i\)`, `\(\mu_i\)` and `\(m\)`.

---

&lt;!-- Multiple hypothesis testing --&gt;

# A Multiple Hypothesis Testing Problem

We want to test a series of hypotheses
`\begin{align*}
H_{0i} : \mu_i = 0
\end{align*}`
using the corresponding `\(z\)`-values `\(z_1, \cdots, z_n\)` with each `\(z_i\)` an observation/statistic following `\(\mathcal{N}(\mu_i, 1)\)` with density `\(\phi(\cdot; \mu_i, 1)\)`. The overall density of `\(z\)`-values can be written as
`$$f(z)=\pi_0\phi(z; 0, 1) + (1-\pi_0)\int\phi(z; \mu, 1)dG(\mu),$$`
where

`$$G(\mu) = \lim\limits_{n\to\infty}\frac{\sum_{i = 1}^n\mathbf{1}(\mu\geq\mu_i)\mathbf{1}(\mu_i\not=0)}{\sum_{i = 1}^n\mathbf{1}(\mu_i\not=0)}.$$`

&amp;nbsp;

Our goal: Estimate `\(\pi_0\)` (null proportion) and `\(G\)`.

---

The prostate data &lt;a name=cite-RN255&gt;&lt;/a&gt;([Singh, et al., 2002](http://www.sciencedirect.com/science/article/pii/S1535610802000302)) is used as an illustration.

---

&amp;nbsp;

&amp;nbsp;

Expect a positive null proportion but the (unrestricted) NPMLE will not have a positive null proportion, almost surely.

Estimating the null proportion seems to be very difficult.

--

&amp;nbsp;

Our approach:

 - For every `\(\pi_0\)`, compute the NPMLE and obtain the profile likelihood
 
`$$\tilde{\ell}_n(\pi_0) = \sup_{G\in\Gamma}\sum_{i = 1}^n\log\left\{\pi_0\phi(z_i; 0, 1) + (1-\pi_0)\int\phi(z_i; \mu, 1)dG(\mu)\right\}$$`
 - Obtain  `\(\hat{\pi}_0\)` using `\(\tilde{\ell}_n(\pi_0)\)` for all `\(\pi_0\in[0, 1]\)`

---

---

&amp;nbsp;

&amp;nbsp;

&amp;nbsp;

We propose the estimated null proportion `\(\hat{\pi}_0\)` to be the root of the expression
`$$\tilde{\ell}_n(0) - \tilde{\ell}_n(\hat{\pi}_0) = q(n, \alpha),$$`
where `\(q(n, \alpha)\)` is a thresholding function.

&amp;nbsp;

A thresholding function can be of AIC type `\((q(n, \alpha) = 1)\)` or BIC type `\((q(n, \alpha) = \frac{1}{2}\log{n})\)`.

# Numerical Studies

The model to generate the synthetic datasets is 
`$$H(\mu) = \pi_0\mathbf{1}(\mu\geq 0) + (1 - \pi_0) \hat{G}_{0.9}.$$`

&amp;nbsp;

More details:

 * `\(\pi_0\)` = 0.5, 0.7, 0.9;
 
 * number of observations = 1500, 3000, 6000, 12000, 24000, 48000 (large-scale computation is used for 12000, 24000, 48000);
 
 * Comparison: locfdr &lt;a name=cite-RN143&gt;&lt;/a&gt;([Efron, 2010b](#bib-RN143)), ECF &lt;a name=cite-RN209&gt;&lt;/a&gt;([Jin, et al., 2007](https://doi.org/10.1198/016214507000000167)) and mixfdr &lt;a name=cite-RN224&gt;&lt;/a&gt;([Muralidharan, et al., 2012](https://CRAN.R-project.org/package=mixfdr));
 
 * 100 replications.

&lt;!-- Covariance matrix estimation --&gt;

---

# Covariance Matrix Estimation

We want to find a covariance matrix estimator by finding a correlation matrix estimator such that the expected `\(L_2\)`-norm (risk) is minimised, i.e.,
`$$\min\limits_{\hat{\mathbf{P}}}\mathbb{E}[||\hat{\mathbf{P}}(\mathbf{R}) - \mathbf{P}||_2],$$`
where `\(\mathbf{R}\)` is the `\(p\times p\)` sample correlation matrix computed from `\(n\)` observations and `\(\mathbf{P}\)` is the true correlation matrix.

&amp;nbsp;

We focus on finding the estimator (action) `\(\hat{\mathbf{P}}(\mathbf{R})\)` in the class of simple and symmetric estimators. According to &lt;a name=cite-RN380&gt;&lt;/a&gt;[Greenshtein, et al. (2009)](https://doi.org/10.1214/09-LNMS5716), the action `\(\hat{\mathbf{P}}(\mathbf{R})\)` is simple and symmetric if
`$$\hat{\mathbf{P}}(\mathbf{R}) = (\hat{\rho}(r_{ij}))_{1\leq i, j\leq p}.$$`


---

**Fisher transformation**
`$$z = \text{arctanh}(r)\qquad v = \text{arctanh}(\rho)$$`
`\(r\)` is a sample correlation coefficient and `\(\rho\)` is the corresponding true correlation coefficient.

&amp;nbsp;

**Summary:**

| | `\((r, \rho)\)` | `\((z, v)\)` |
|-----| :-: | :-: |
|Action| `\(\frac{\int\rho g(r;\rho)dH(\rho)}{\int g(r; \rho)dH(\rho)}\)` | `\(\frac{\int\tanh(v) g(z;v)dH(v)}{\int g(z; v)dH(v)}\)` |
|component density| `\(g(r;\rho)=\phi\left(r; \rho, \frac{(1 - \rho^2)}{\sqrt{n}}\right)\)` | `\(g(z;v)=\phi\left(z; v, \frac{1}{\sqrt{n - 3}}\right)\)`|
|Large-scale Computation| variational `\(h\)` | fixed `\(h\)` |

In practice, `\(H\)` is not known and can be estimated non-parametrically from observations.

 - .small[Fast approximation when the sample size is large without losing too much accuracy]
 
#### A FDR-controlling procedure

 - .small[Higher number of rejections]
 
 - .small[Computation does not scale with sample size]

# The prostate data

The prostate data concerns with the genes of which expression levels are different between the prostate and the normal patients. The data consists of 6033 gene expressions from 102 patients. The first 50 patients are the normal controls while the last 52 are the cancer patients. The goal is to investigate the proportion of null effects (or equivalently, the proportion of the non-null effects) and identify the significant `\(z\)`-values which may lead to the significant gene expressions.

# The constrained Newton method

.panelset[
.panel[.panel-name[Intro]

 Use gradient function to find new support points and use non-negative least squares (NNLS) to find weights

 - Gradient function at `\(s\)`-th iteration (directional derivative from `\(G_s\)` to `\(\mathbf{1}_{\mu}\)`)
 `$$d(\mu, G) = \sum\limits_{i = 1}^n\frac{f(x_i; \mu, \sigma)}{f(x_i; G_s, \sigma)} - n$$`
 
 - Non-Negative Least Squares
 `$$\pi = \arg\,\min\limits_{\mathbf{x}} ||\mathbf{y} - \mathbf{A}\mathbf{x}||_2 \text{ subject to }\mathbf{x}\geq 0$$`
]

---

Define the `\(p\)`-th weak moment as
`$$\mu_p(H) =\left\{\sup\limits_{x&gt;0}x^p\int_{|u|&gt;x}dH(u)\right\}^{1/p},$$`
and 
`$$\mu_p(\Gamma) = \sup\limits_{H\in\Gamma} \mu_p(H).$$`
According to Theorem 1 in &lt;a name=cite-RN306&gt;&lt;/a&gt;[Jiang, et al. (2016)](#bib-RN306), there exists a universal constant `\(k_*&gt;0\)` such that for large `\(n\)` and all `\(k\geq k_*\)`,
`$$\mathbb{P}(T_n(\pi_0)\geq 3kt_{n, p})\leq\exp\left(-\frac{kt_{n, p}}{2\log{n}}\right)\leq n^{-k},$$`
where
`$$t_{n,p}\asymp\begin{cases}
n^{1/(1 + p)}(\log{n})^{(2 + 3p) / (2 + 2p)},&amp; \mu_p(\Gamma_{\pi_0}) = O(1)\text{ for a fixed \(p\)}\\
\log^2{n}, &amp; H(M) - H(-M) = 1\text{ for every \(H\in\Gamma_{\pi_0}\)}
\end{cases}$$`

# The BH and AS method

A detailed description of the BH method is in &lt;a name=cite-RN193&gt;&lt;/a&gt;[Benjamini, et al. (1995)](https://doi.org/10.2307/2346101) and the AS method is in &lt;a name=cite-RN334&gt;&lt;/a&gt;[Gavrilov, et al. (2009)](#bib-RN334). Let `\(p_{(1)}\leq p_{(2)}\leq\cdots\leq p_{(n)}\)` be the ordered `\(p\)`-values, and we want to control the FDR at level `\(\alpha\)`.

For the BH method, this is essentially the Bonferroni-type procedure. Let `\(k\)` be the largest `\(i\)` for which `\(p_{(i)}\leq\frac{i}{n}\alpha\)`, and the first `\(k\)` ordered hypotheses are rejected.

For the AS method, let `\(k\)` be the largest `\(i\)` for which `\(p_{(j)}\leq j\alpha/(n + 1 - j(1 - q))\)` for all `\(j\leq i\)`, and the first `\(k\)` ordered hypotheses are rejected.

---

# A FDR-controlling procedure

The false discovery rate (FDR) is defined as
`$$\text{FDR} = \mathbb{E}[V/R|R&gt;0]\mathbb{P}(R&gt;0),$$`
where `\(V\)` is the number of null hypotheses that are declared significant and `\(R\)` is the number of hypotheses rejected.

Our proposed method is a slight modification to Theorem 2 in [Benjamini, et al. (1995)](https://doi.org/10.2307/2346101). Given a fixed `\(\alpha\)` and a mixing distribution `\(H_{\pi_0}\)`, we consider the global optimisation problem
`$$\max\limits_{a, b\in\mathbb{R}}\qquad F(a; H_{\pi_0}, \sigma) + 1 - F(b; H_{\pi_0}, \sigma)$$`
subject to 
`$$\begin{align*}
a - b&amp;\leq 0,\\
\frac{\pi_0[\Phi(a; 0, \sigma) + 1 - \Phi(b; 0, \sigma)]}{F(a; H_{\pi_0}, \sigma) + 1 - F(b; H_{\pi_0}, \sigma)} &amp;\leq \alpha.
\end{align*}$$`
